import{o as t,c as d,a as e}from"./app.28c4bf22.js";const a='{"title":"Calendar 日历","description":"","frontmatter":{},"headers":[{"level":2,"title":"Calendar/CalendarPopup/CalendarView 的公共 Props","slug":"calendar-calendarpopup-calendarview-的公共-props"},{"level":3,"title":"v-modal 的合法值","slug":"v-modal-的合法值"},{"level":3,"title":"dayHandler 函数","slug":"dayhandler-函数"},{"level":2,"title":"Calendar 日历选择器","slug":"calendar-日历选择器"},{"level":2,"title":"Calendar Props","slug":"calendar-props"},{"level":3,"title":"formatter 函数","slug":"formatter-函数"},{"level":2,"title":"Calendar Events","slug":"calendar-events"},{"level":3,"title":"DetailObject 的结构","slug":"detailobject-的结构"},{"level":2,"title":"CalendarPopup 日历弹窗","slug":"calendarpopup-日历弹窗"},{"level":2,"title":"CalendarPopup Props","slug":"calendarpopup-props"},{"level":2,"title":"CalendarPopup Events","slug":"calendarpopup-events"},{"level":3,"title":"VisibleState 值说明","slug":"visiblestate-值说明"},{"level":2,"title":"CalendarView 日历选择","slug":"calendarview-日历选择"},{"level":2,"title":"CalendarView Events","slug":"calendarview-events"}],"relativePath":"components/Calendar.md","lastUpdated":1624583539153}',r={},l=e('<h1 id="calendar-日历"><a class="header-anchor" href="#calendar-日历" aria-hidden="true">#</a> Calendar 日历</h1><h2 id="calendar-calendarpopup-calendarview-的公共-props"><a class="header-anchor" href="#calendar-calendarpopup-calendarview-的公共-props" aria-hidden="true">#</a> Calendar/CalendarPopup/CalendarView 的公共 Props</h2><table><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th>必填</th><th>说明</th></tr></thead><tbody><tr><td>v-modal</td><td>Date/Date[]</td><td>[]</td><td>否</td><td>选中值</td></tr><tr><td>min-date</td><td>Date</td><td>当前日期</td><td>否</td><td>可选最小值</td></tr><tr><td>max-date</td><td>Date</td><td>当前日期的六个月后</td><td>否</td><td>可选最大值</td></tr><tr><td>initial-mode</td><td>string</td><td>&#39;single&#39;</td><td>否</td><td>模式：<code>single</code> 表示选择一天，<code>range</code> 选择一个日期区间</td></tr><tr><td>allow-same-day</td><td>boolean</td><td>false</td><td>否</td><td><code>range</code> 模式生效，设置开始结束时间是否可以同一天</td></tr><tr><td>max-range</td><td>number</td><td>Infinity</td><td>否</td><td><code>range</code> 模式生效，选择区间的最长天数</td></tr><tr><td>day-handler</td><td>Function</td><td></td><td>否</td><td>日历每个日期处理函数</td></tr></tbody></table><h3 id="v-modal-的合法值"><a class="header-anchor" href="#v-modal-的合法值" aria-hidden="true">#</a> v-modal 的合法值</h3><p><code>Date</code> 类型，或者可以被 <code>new Date(value)</code>的有效值，如果是 <code>range</code> 模式，则为数组形式。</p><h3 id="dayhandler-函数"><a class="header-anchor" href="#dayhandler-函数" aria-hidden="true">#</a> dayHandler 函数</h3><p>dayHandler(Object: Day) =&gt; Day</p><p>日历中的每个日期都对应一个 Day 对象，通过 <code>day-handler</code> 属性可以修改 Day 对象的内容后返回。</p><table><thead><tr><th>值</th><th>类型</th><th>说明</th></tr></thead><tbody><tr><td>date</td><td>Date</td><td>日期对应的 Date 对象，该字段修改无效</td></tr><tr><td>state</td><td>string</td><td>日期当前的状态，有：<code>selected</code> 选中，<code>startSelected</code> 开始（initialMode=&quot;range&quot;下），<code>endSelected</code> 结束（initialMode=&quot;range&quot;下），<code>disabled</code> 禁用。在空字符串的情况下，可以设置为 <code>disabled</code> 强制设置该日期为禁用（一般在票卖完的情况下设置）</td></tr><tr><td>text</td><td>string</td><td>日期文本，不建议修改</td></tr><tr><td>topText</td><td>string</td><td>日期上方展示文本，一般可修改为“节日名称”、“今天”、“明天”、“开始”、“结束”等</td></tr><tr><td>topHighlight</td><td>boolean</td><td>日期上方展示文本是否高亮</td></tr><tr><td>bottomText</td><td>string</td><td>日期下方展示文本，一般可修改为“机票价格”、“酒店价格”、“特价”、“热门”等</td></tr><tr><td>bottomHighlight</td><td>boolean</td><td>日期下方展示文本是否高亮</td></tr><tr><td>dateString</td><td>string</td><td>日期对应的格式化时间（<code>YYYY-MM-DD</code>），如：2020-11-11，该字段不影响展示</td></tr></tbody></table><h2 id="calendar-日历选择器"><a class="header-anchor" href="#calendar-日历选择器" aria-hidden="true">#</a> Calendar 日历选择器</h2><ul><li>可以配合 <a href="./Form.html">Form</a> 和 <a href="./Form.html#formitem-表单项">FormItem</a> 使用。</li></ul><h2 id="calendar-props"><a class="header-anchor" href="#calendar-props" aria-hidden="true">#</a> Calendar Props</h2><table><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th>必填</th><th>说明</th></tr></thead><tbody><tr><td>name</td><td>string</td><td></td><td>否</td><td><a href="./Form.html">Form</a> 的标识</td></tr><tr><td>placeholder</td><td>string</td><td></td><td>否</td><td>没有选中值的提示，也会用在弹窗标题上</td></tr><tr><td>disabled</td><td>boolean</td><td>false</td><td>否</td><td>是否禁用</td></tr><tr><td>formatter</td><td>Function</td><td></td><td>否</td><td>选中项格式化函数</td></tr><tr><td>show-confirm</td><td>boolean</td><td>false</td><td>否</td><td>弹窗是否展示确定按钮</td></tr><tr><td>show-close</td><td>boolean</td><td>false</td><td>否</td><td>弹窗是否展示关闭按钮</td></tr></tbody></table><h3 id="formatter-函数"><a class="header-anchor" href="#formatter-函数" aria-hidden="true">#</a> formatter 函数</h3><p>formatter(value: Date[]) =&gt; any</p><p>可以对选中后的 value 进行修改，会应用在 <code>v-modal</code> 和表单校验中</p><h2 id="calendar-events"><a class="header-anchor" href="#calendar-events" aria-hidden="true">#</a> Calendar Events</h2><table><thead><tr><th>事件</th><th>描述</th><th>回调函数参数</th></tr></thead><tbody><tr><td>change</td><td>选择后值发生改变时触发</td><td><a href="./Calendar.html#detailobject-的结构">DetailObject</a></td></tr></tbody></table><h3 id="detailobject-的结构"><a class="header-anchor" href="#detailobject-的结构" aria-hidden="true">#</a> DetailObject 的结构</h3><table><thead><tr><th>值</th><th>类型</th><th>说明</th></tr></thead><tbody><tr><td>value</td><td>[Date]/[Date, Date]</td><td>选择的值，<code>range</code> 模式下有开始 Date 和结束 Date 两个实例</td></tr><tr><td>valueArray</td><td>number[][]</td><td>如：[[2021, 5, 1], [2021, 5, 30]]</td></tr><tr><td>formatted</td><td>string</td><td>选中值对应的描述文本</td></tr><tr><td>rangeCount</td><td>number</td><td>选择区间持续的天数（含首尾）</td></tr></tbody></table><h2 id="calendarpopup-日历弹窗"><a class="header-anchor" href="#calendarpopup-日历弹窗" aria-hidden="true">#</a> CalendarPopup 日历弹窗</h2><h2 id="calendarpopup-props"><a class="header-anchor" href="#calendarpopup-props" aria-hidden="true">#</a> CalendarPopup Props</h2><table><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th>必填</th><th>说明</th></tr></thead><tbody><tr><td>v-model:visible</td><td>boolean</td><td>false</td><td>否</td><td>是否显示</td></tr><tr><td>title</td><td>string</td><td></td><td>否</td><td>弹窗标题</td></tr><tr><td>show-confirm</td><td>boolean</td><td>false</td><td>否</td><td>选择时是否展示确定按钮</td></tr><tr><td>show-close</td><td>boolean</td><td>false</td><td>否</td><td>是否展示关闭按钮</td></tr></tbody></table><h2 id="calendarpopup-events"><a class="header-anchor" href="#calendarpopup-events" aria-hidden="true">#</a> CalendarPopup Events</h2><table><thead><tr><th>事件</th><th>描述</th><th>回调函数参数</th></tr></thead><tbody><tr><td>confirm</td><td>选择完毕后触发 / <code>showConfirm</code> 点击确定按钮后触发</td><td><a href="./Calendar.html#detailobject-的结构">DetailObject</a></td></tr><tr><td>visible-state-change</td><td>展示隐藏时触发</td><td>{ state: <a href="./Calendar.html#visiblestate-值说明">VisibleState</a> }</td></tr></tbody></table><h3 id="visiblestate-值说明"><a class="header-anchor" href="#visiblestate-值说明" aria-hidden="true">#</a> VisibleState 值说明</h3><table><thead><tr><th>值</th><th>说明</th><th>备注</th></tr></thead><tbody><tr><td>show</td><td>展示时触发</td><td></td></tr><tr><td>shown</td><td>展示且动画结束后触发</td><td></td></tr><tr><td>hide</td><td>隐藏时触发</td><td>可能携带其他参数 cancel, maskClick, closeClick 等</td></tr><tr><td>hidden</td><td>隐藏且动画结束后触发</td><td>可能携带其他参数 cancel, maskClick, closeClick 等</td></tr></tbody></table><h2 id="calendarview-日历选择"><a class="header-anchor" href="#calendarview-日历选择" aria-hidden="true">#</a> CalendarView 日历选择</h2><p>平铺形式。</p><h2 id="calendarview-events"><a class="header-anchor" href="#calendarview-events" aria-hidden="true">#</a> CalendarView Events</h2><table><thead><tr><th>事件</th><th>描述</th><th>回调函数参数</th></tr></thead><tbody><tr><td>select</td><td>选择后触发</td><td><a href="./Calendar.html#detailobject-的结构">DetailObject</a></td></tr></tbody></table>',31);r.render=function(e,a,r,h,o,n){return t(),d("div",null,[l])};export default r;export{a as __pageData};
